import logo from './logo.svg';
import './App.css';

function Header() {
  return (
      <ul style={{display:"flex", listStyle:"none", justifyContent: "center", gap: "30px"}}>
          <li>My List</li>
          <li>My Profile</li>
          <li>Top Charts</li>
          <li>Settings</li>
      </ul>
  )
}

function App() {
  return (
    <div className="App">
     <Header/>
    </div>
  );
}

export default App;
